import React from "react";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import { TodoListPage } from "./pages/todo-list-page/index";
import { CompletedTodos } from "./features/todos/components/CompletedTodos";

const App: React.FC = () => {
    return (
        <Router>
            <nav>
                <Link to="/">Создание задач</Link>
                <Link to="/completed">Выполненные задачи</Link>
            </nav>
            <Switch>
                <Route path="/" exact component={TodoListPage} />
                <Route path="/completed" component={CompletedTodos} />
            </Switch>
        </Router>
    );
};

export default App;
